import React from "react";

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Pathmodels from '../Section1/Frame 35.svg'
function Section4(){
    return(
<div className="Section1-whole">
<Container className="Section1">
<Row ><Col sm={6}><img src={Pathmodels} alt="src" className="Section1-img"></img></Col>
        <Col sm={5}>
        <h1 className="Section1-content">The unseen of spending three years at Pixelgrade</h1>
        <h1 >from 8 years</h1>
<p className="Section2-content-parah">Where to grow your business as a photographer: site or social media?.</p>
<button className="Section2-button">Register</button></Col>

</Row>
</Container>
</div>
    );
}
export default Section4;
